import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 23.1-1700 Corporate name; name of the University.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-1700.md","filePath":"vacode/23.1-1700.md"}'),a={name:"vacode/23.1-1700.md"},n=r('<h1 id="§-23-1-1700-corporate-name-name-of-the-university" tabindex="-1">§ 23.1-1700 Corporate name; name of the University. <a class="header-anchor" href="#§-23-1-1700-corporate-name-name-of-the-university" aria-label="Permalink to &quot;§ 23.1-1700 Corporate name; name of the University.&quot;">​</a></h1><p>A. The board of visitors of Longwood University (the board) is a corporation under the name and style of &quot;The Visitors of Longwood University&quot; and has, in addition to its other powers, all the corporate powers given to corporations by the provisions of Title 13.1 except those powers that are confined to corporations created pursuant to Title 13.1. The board shall at all times be under the control of the General Assembly.</p><p>B. The institution shall be known as Longwood University (the University).</p><p>1964, c. 159, §§ 23-182, 23-183; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0158" target="_blank" rel="noreferrer">158</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0257" target="_blank" rel="noreferrer">257</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),i=[n];function s(l,c,h,p,d,_){return t(),o("div",null,i)}const v=e(a,[["render",s]]);export{m as __pageData,v as default};
